        <p>
          Nome: {pros.texto.nome}
          <br></br>
          Idade: {pros.texto.idade}
        </p>
        <a href='https://github.com/{prop.texto.github}/' target="_blank">GitHub: {prop.texto.github}</a>
      </div>
    </div>
  );
}

